import './RouteFilter.css';
import RangeSlider from '../MUI-Libary/RangeSlider';

function RouteFilter(props) {
  return (
    <div className="route-filter">
      <div className="route-distance">
        <h3>Route Distance (mi)</h3>
        <RangeSlider updateParams={props.updateParams} />
      </div>
      <div className="route-location">
        <div>Route Location</div>
        <select name="location-select" id="location-select" multiple>
          <option value="N Arlington">N Arlington</option>
          <option value="NE D.C.">NE D.C.</option>
          <option value="SE D.C.">SE D.C.</option>
          <option value="SW D.C.">SW D.C.</option>
          <option value="NW D.C.">NW D.C.</option>
        </select>
      </div>
    </div>
  );
}

export default RouteFilter;
